import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import './index.css';

import NavBar from './components/NavBar';
import {
  LandingPage,
  AboutMePage,
  GalleryPage,
  ContactPage,
  ShopPage,
} from './pages';

ReactDOM.render(
  <Router>
    <NavBar />
    <LandingPage />
  </Router>,
  document.getElementById('root')
);
